document.addEventListener("DOMContentLoaded",()=>{const t=document.querySelectorAll('[class*="width-"]');t.forEach(t=>{const e=t.className.split(" ");e.forEach(e=>{if(e.startsWith("width-")){const o=e.split("-");t.style.width=o.pop()+"%"}})});let e=document.querySelectorAll(".ranking-color");e.forEach(function(t){window.getComputedStyle(t,null).getPropertyValue("background-color")})});